description:
Verenigd Koninkrijk
Actie / Thriller
92 minuten

goed

met Billy Murray, Craig Fairbrass en Danny Midwinter

Een illegale Russische bende onder leiding van de meedogenloze Cristi neemt de stad over. Ze smokkelen Oost-Europeanen het 
Verenigd Koninkrijk binnen om ze dan uit te buiten: de vrouwen in de seksclubs en de mannen in de illegale kooigevechten. 
Wanneer ze per ongeluk de lokale zakenman Gabe Taylor tegen het lijf lopen escaleert een gevecht tussen de beiden kampen. Maar 
wanneer de dochter van Gabe wordt gekidnapt wordt het pas echt oorlog.
